			 src="https://m.media-amazon.com/images/G/01/digital/video/sonata/US_SVOD_3P_SUITS_S9/58845186-9591-4413-9b93-1d9e0451026e._UR3000,600_SX1500_FMwebp_.jpg" 
			 alt=""
			 />
		</div>
	)
}

export default Home;
